sys_variable_value.value:
answer = (function (scratchpad) {
    if (!gs.nil(scratchpad.approveBy)) {
        var approveBy = new GlideDateTime(scratchpad.approveBy);
        if (approveBy.before(new GlideDateTime()))
            return 'no';
    }
    return 'yes';
})(workflow.scratchpad());

